import axios from 'axios'
import {GET_ALL_CURRENCY_FAIL, GET_ALL_CURRENCY_REQUEST, GET_ALL_CURRENCY_SUCCESS, TOGGLE_MODAL} from "./actionTypes";

export const getAllCurrency = () => {

    return {
        types: [GET_ALL_CURRENCY_REQUEST, GET_ALL_CURRENCY_FAIL, GET_ALL_CURRENCY_SUCCESS],
        promise: (apiClient) => apiClient.gett('currency/')
    }
}

export const toggleModal = () => {

    return {
        type: TOGGLE_MODAL
    }
}
